import React, { useState,useEffect } from 'react';
import axios from 'axios';
import PropTypes from 'prop-types';

export default function Text_area(props) {
  var val;
    // const [tno, setTno] = useState('');
    const [results, setResults] = useState('');
    const [status, setStatus] = useState(false);
    const [concertData, setConcertData] = useState([]);
function parse(){
  var arr=[]
  for (var i=0;i<concertData.map(item => item.tname).length;i++){
    arr[i]=`${i} ${concertData.map(item => item.tname)[i]} \n`;
  }
  console.log(arr)
  return arr;
}
app.get('/ShowAndId', (req, res) => {
  const sql = "SELECT * FROM todolists where status='today';";
  
 
  
  db.query(sql,[], (err, data) => {
    if (err) {
      console.error("Error", err);
      res.status(500).json({ message: "Failed to show data" });
    } else {
      if (data.length > 0) {
        console.log("Data shown successfully");
        res.json(data);
      } else {
        res.json({ message: "No data found" });
      }
    }
  });
});

    const [values, setValues] = useState({
        tname: "",
        
      });

      const handleInput = (event) => {
        setValues((prev) => ({ ...prev, [event.target.name]: event.target.value }));
      };
    
     
      const handleSubmit = (e) => {
        e.preventDefault();
        // const err=validation(values);
        // setErrors(err)
        // if(err.name==="" && err.email==="" && err.password===""){
        fetch("http://localhost:8081/Create", {
          method: "POST",
          headers: {
            "Content-Type": "application/json",
          },
          body: JSON.stringify({
            tname: values.tname,
           
          }),
        })
          .then((res) => res.json())
          .then((data) => {
            if (data.message) {
            //   navigate("/Created");
            val=" ";
            } else {
              console.log(data);
            //   navigate("/Created");
            }
          })
          .catch((error) => {
            console.error("Error:", error);
          });
        // }
      };
      const handleSubmit2 = (e) => {
        e.preventDefault();
        // const err=validation(values);
        // setErrors(err)
        // if(err.name==="" && err.email==="" && err.password===""){
        fetch("http://localhost:8081/CreateNext", {
          method: "POST",
          headers: {
            "Content-Type": "application/json",
          },
          body: JSON.stringify({
            tname: values.tname,
           
          }),
        })
          .then((res) => res.json())
          .then((data) => {
            if (data.message) {
            //   navigate("/Created");
            val=" ";
            } else {
              console.log(data);
            //   navigate("/Created");
            }
          })
          .catch((error) => {
            console.error("Error:", error);
          });
        // }
      };



    

  return (
    <div>
        <h5 className=' colorw center2'> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;{props.heading}</h5>

<textarea rows="2" value={results} cols="50" disabled>

</textarea>
<div className='d-inline-flex'  >
<input name='tname' type="text" onChange={handleInput}  placeholder="Enter Text to Add" />
<input name='tno' type='number' placeholder='Id for below function'></input>
</div>



<div className="d-inline-flex">
&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;
{props.text1!==""?<button onClick={props.status=="today"?handleSubmit:handleSubmit2} className='btn btn-success'> {props.text1}</button>
:<></>}
&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;
{props.text2!==""?<button className='btn btn-warning' > {props.text2}</button>
:<></>}

{props.text3!==""?<button className='btn btn-danger'> {props.text3}</button>
:<></>}

{props.text4!==undefined?<button  className='btn btn-primary'> {props.text4}</button>
:<></>}
</div>

    </div>
  )
}
